    name:  string
    messageCount?: number
    isLoggedIn: boolean
}

export const Greet = (props: GreetProps) => {
  return (
    <div>
        {
            props.isLoggedIn ? `Welcome ${props.name} You have ${props.messageCount} unread meassages` : 'Welcome as guest'
        }
        
    </div>
  )
}
